# -*- coding: utf-8 -*-

"""76. 最小覆盖子串(https://leetcode-cn.com/problems/minimum-window-substring/)
"""

from collections import Counter


class Solution:

    def minWindow(self, s: str, t: str) -> str:
        n_t = len(t)
        target = Counter(t)
        answer = ''
        l_answer = 0
        left = 0
        right = 0
        n = len(s)
        while right < n:
            right += 1
            while (right - left >= n_t and
                   self.contains(Counter(s[left:right]), target)):
                if not answer or (right - left) < l_answer:
                    answer = s[left:right]
                    l_answer = right - left
                left += 1
        return answer

    @staticmethod
    def contains(source: Counter, target: Counter) -> bool:
        if len(source) < len(target):
            return False
        for k, v in target.items():
            if source[k] < v:
                return False
        return True


if __name__ == '__main__':
    long_s = ''
    long_t = ''
    input = [['ADOBECODEBANC', 'ABC'], ['a', 'aa'], ['cabwefgewcwaefgcf', 'cae'], [long_s, long_t]]
    for s, t in input:
        output = Solution().minWindow(s, t)
        print(f'S: {s} T: {t} ==> {output}')
